import React from "react"
import ms from "./Messages.module.css";
import Dialog from "@material-ui/core/Dialog";


const DeleteConfirmWindow = (props) =>{
    const closeWindow = () =>{
        props.SetToConfirmDeleting(false)
    }

    return <div>

        <Dialog className={ms.confirmDeletingWindow} open={props.ToConfirmDeleting}>

            <div >
                <h2> Delete messages confirm</h2>
                <span> Are you sure about this? you will can't restored this message </span>
                <button className={ms.confirmDeletingWindowButtons} onClick={props.deleteMessage}>yes </button>

                &nbsp;&nbsp;

                <button className={ms.buttontsDelta}  onClick={closeWindow}> no</button>
            </div>

        </Dialog>

        </div>

}
export default DeleteConfirmWindow
